/** @format */

import { CHANGE_AUTH } from 'actions/types';

export default function(state = false, action) {
	switch (action.type) {
		case CHANGE_AUTH:
			// console.log('TEST auth reducer');
			return action.payload;
		default:
			return state;
	}
}
